import CityDetails from "../components/CityDetails";
import Header from "../components/Header";

function Forecast({ children, cities }) {
    return (
        <div>
            <Header />
            <div className="forecast-container">
                {cities.map((city) => {
                    return (
                        <CityDetails
                            city={city}
                            cities={cities}
                            key={city}
                            onClick={handleCity}
                        />
                    );
                })}
            </div>
        </div>
    );
}

export default Forecast;
